import React, { useState } from 'react'
import { Card, Table, Row, Col, Input, Select, Button } from 'antd'
import { CloseOutlined, MinusOutlined, BorderOutlined } from '@ant-design/icons'

const { Option } = Select

interface DataType {
  key: React.Key
  item: string
  category: string
}

const columns = [
  {
    title: 'Item',
    dataIndex: 'item',
    key: 'item',
  },
  {
    title: 'Category',
    dataIndex: 'category',
    key: 'category',
  },
]

const initialData: DataType[] = [...Array(20)].map((_, index) => ({
  key: index,
  item: `Item ${index}`,
  category: `Category ${index % 5}`,
}))

const App: React.FC = () => {
  const [selectedRowKeys, setSelectedRowKeys] = useState<React.Key[]>([])
  const [data, setData] = useState<DataType[]>(initialData)
  const [favorites, setFavorites] = useState<DataType[]>([])
  const [makeFavorite, setMakeFavorite] = useState(false)

  const rowSelection = {
    onChange: (selectedRowKeys: React.Key[], selectedRows: DataType[]) => {
      setSelectedRowKeys(selectedRowKeys)
    },
    getCheckboxProps: (record: DataType) => ({
      disabled: record.item === 'Disabled User', // Column configuration not to be checked
    }),
  }

  const handleCreateFavorite = () => {
    if (makeFavorite) {
      const newFavorites = data.filter((item) => selectedRowKeys.includes(item.key))
      setFavorites([...favorites, ...newFavorites])
    }
  }
  const getSelectedFavorites = () => {
    return favorites.filter((fav) => selectedRowKeys.includes(fav.key));
  }

  const deleteSelectedFavorites = () => {
    const remainingFavorites = favorites.filter((fav) => !selectedRowKeys.includes(fav.key));
    setFavorites(remainingFavorites);
    setSelectedRowKeys([]); // Seçili öğeleri sıfırla
  }


  const handleResetFavorites = () => {
    setFavorites([])
  }

  return (
    <div className="custom-window" style={{ width: '100%', maxWidth: '960px', margin: '0 auto', border: '1px solid #ccc', borderRadius: '5px', overflow: 'hidden' }}>
      <div className="window-header" style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: '10px', backgroundColor: '#f0f0f0', borderBottom: '1px solid #ccc' }}>
        <h2 style={{ flex: 1 }}>Flight Graphs</h2>
        <Button icon={<MinusOutlined />} />
        <Button icon={<BorderOutlined />} />
        <Button icon={<CloseOutlined />} />
      </div>

      <Row gutter={16} style={{ padding: '20px', backgroundColor: '#f0f0f0' }}>
        <Col span={12} style={{ display: 'flex', flexDirection: 'column' }}>
          <Card style={{ flexGrow: 1, overflow: 'auto' }}>
            <Input.Group compact>
              <label htmlFor="">Search:</label>
              <Input style={{ width: 'calc(50% - 4px)', marginRight: '4px' }} />
              <Select defaultValue="" style={{ width: '30%' }}>
                <Option value="">Select Category</Option>
              </Select>
              <button>x</button>
            </Input.Group>
            <Table rowKey="key" columns={columns} dataSource={data} pagination={false} rowSelection={rowSelection} scroll={{ y: 240 }} />
          </Card>
          <div style={{ marginTop: '20px' }}>
            <Button type="primary" style={{ marginRight: '8px' }} onClick={handleCreateFavorite}>Create</Button>
            <input type="checkbox" checked={makeFavorite} onChange={(e) => setMakeFavorite(e.target.checked)} style={{ flex: 1, marginRight: '8px' }} />
            <label htmlFor="checkbox">Make Favorite</label>
          </div>
        </Col>
        <Col span={12} style={{ display: 'flex', flexDirection: 'column' }}>
          <Card title="Favorites" style={{ flexGrow: 1 }}>
            {favorites.length > 0 ? (
              <ul>
                {favorites.map((item) => (
                  <li key={item.key}>
                    {item.item} - {item.category} 
                  </li>
                ))}
              </ul>
            ) : (
              'No favorites selected.'
            )}
          </Card>
          <div style={{ marginTop: '20px' }}>
          <Button type="primary" style={{ marginRight: '8px' }} onClick={deleteSelectedFavorites}>
  Delete Favorite
</Button>
 <Button type="primary" style={{ marginRight: '8px' }} onClick={handleResetFavorites}>Reset Favorites</Button>
          </div>
        </Col>
      </Row>
    </div>
  )
}

export default App
